import { createElement, useCallback, useEffect, useState } from "react";
import { View, Image, StyleSheet, Text, TouchableOpacity } from "react-native";
import MapView, { Marker, Callout } from "react-native-maps";
import  { SvgUri } from 'react-native-svg';
// import { Badge } from "./components/Badge";
const uri = 'data:image/png;base64,'


export function CustomMapMarker({ style, onClick, datasource, callout, callOutClick }) {
    const [latitude, setLatitude] = useState([]);
    const [longitude, setLongitude] = useState([]);
    const [callOutAttributes, setCallOutAttributes] = useState([]);
    const [initialRegion, setInitialRegion] = useState({
        "latitude": 25.276987,
        "longitude": 55.296249,
        "latitudeDelta": 0.0922,
        "longitudeDelta": 0.0421,
    });


    const onClickHandler = useCallback(() => {
        if (onClick && onClick.canExecute && !onClick.isExecuting) {
            onClick.execute();
        }
    }, [onClick]);
    const calloutOnClickHandler = useCallback(() => {
        if (callOutClick && callOutClick.canExecute && !callOutClick.isExecuting) {
            callOutClick.execute();
        }
    }, [callOutClick]);

    useEffect(() => {
        try {
            const { items } = datasource;
            if (datasource.status === "available" && datasource.items.length > 0) {
                var latitude = items.map(
                    (item, index) => item[Object.getOwnPropertySymbols(item)[0]].jsonData.attributes.Latitude.value
                );
                var longitude = items.map(
                    (item, index) => item[Object.getOwnPropertySymbols(item)[0]].jsonData.attributes.Longitude.value
                );

                setLatitude(latitude);
                setLongitude(longitude);

                var minLat = 0;
                var maxLat = 0;
                var minLng = 0;
                var maxLng = 0;
                var index = 0;

                latitude.forEach((marker) => {
                    console.log("marker", marker, "index", index)
                    minLat = Math.min(minLat, parseFloat(marker));
                    maxLat = Math.max(maxLat, parseFloat(marker));
                    minLng = Math.min(minLng, parseFloat(longitude[index]));
                    maxLng = Math.max(maxLng, parseFloat(longitude[index]));
                    index++;
                });
                const midLat = (minLat + maxLat) / 2;
                const midLng = (minLng + maxLng) / 2;
                const deltaLat = maxLat - minLat + 0.1; // Add a little extra padding
                const deltaLng = maxLng - minLng + 0.1; // Add a little extra padding

                var demo = {
                    latitude: midLat,
                    longitude: midLng,
                    latitudeDelta: 0.1,
                    longitudeDelta: 0.1,
                }
                setInitialRegion(demo);
            } else {
                setLatitude([]);
                setLongitude([]);
            }
        } catch (e) {
            console.warn("error", e);
        }


    }, [datasource]);

    useEffect(() => {
        try {
            const { items } = callout;
            if (callout.status === "available" && callout.items.length > 0) {
                var attributes = items.map(
                    (item, index) => item[Object.getOwnPropertySymbols(item)[0]].jsonData.attributes
                );
                setCallOutAttributes(attributes);
                console.warn("attributes", attributes[0])
            } else { }
        } catch (e) {
            console.warn("error", e);
            setCallOutAttributes([]);
        }
    }, [callout]);
    return (
        <View style={styles.container}>
            <MapView
                style={styles.map}
                initialRegion={initialRegion}

            >
                {latitude.length > 0 && latitude.map((item, index) => (
                    <Marker
                        key={index}
                        coordinate={{ latitude: parseFloat(item), longitude: parseFloat(longitude[index]) }}
                    >

                        <Image source={{ uri: uri }} style={styles.customMarker} />
                        <Callout style={styles.calloutContainer}>

                            <View style={styles.DashboardCard}>
                                <View style={{ height: 120 }}>
                                    {/* <Image source={{ uri: uri }} style={{ height: 80, width: 150, resizeMode: 'contain' }} /> */}
                                    <SvgUri
                                        width="200"
                                        height="200"
                                        uri= 'http://thenewcode.com/assets/images/thumbnails/homer-simpson.svg'
                                    />
                                </View>
                                <View style={styles.CardContentContainer}>
                                    <View>
                                        <Text style={{ fontSize: 16, fontWeight: "bold", color: 'black' }}>{callOutAttributes[index]?.CarName?.value}</Text>
                                    </View>
                                    <View style={{ display: "flex", flexDirection: "row", gap: 15, width: "100%", alignItems: "center", marginVertical: 5 }}>
                                        <View style={{ width: 10, height: 10, borderRadius: 5, backgroundColor: '#a49bbc', marginRight: 7 }}></View>
                                        <Text style={{ fontSize: 12, fontWeight: "bold", color: 'grey' }}>{callOutAttributes[index]?.CarName?.value}</Text>
                                    </View>
                                    <View style={styles.CardBadgeContainer}>
                                        <View style={styles.DashboardBadge}>
                                            <Image source={{ uri: uri }} style={{ height: 10, width: 10, resizeMode: 'contain' }} />
                                            <Text style={{ fontSize: 12, fontWeight: "bold", color: 'black' }}>{callOutAttributes[index]?.Seats?.value} Seats</Text>
                                        </View>
                                        <View style={styles.DashboardBadge}>
                                            <Image source={{ uri: uri }} style={{ height: 10, width: 10, resizeMode: 'contain' }} />
                                            <Text style={{ fontSize: 10, fontWeight: "bold", color: 'black' }}>{callOutAttributes[index]?.Transmission?.value}</Text>
                                        </View>
                                        <View style={styles.DashboardBadge}>
                                            <Image source={{ uri: uri }} style={{ height: 10, width: 10, resizeMode: 'contain' }} />
                                            <Text style={{ fontSize: 10, fontWeight: "bold", color: 'black' }}>{callOutAttributes[index]?.Doors?.value} Doors</Text>
                                        </View>
                                    </View>
                                </View>
                                <View>
                                    <View>
                                        <Text style={{ fontSize: 14, fontWeight: "bold", color: "black" }}>{callOutAttributes[index]?.Price?.value}.00 SR/Day</Text>
                                    </View>
                                    <View style={{ width: "100%", display: "flex", alignItems: "center", justifyContent: "center" }}>
                                        <TouchableOpacity onPress={() => calloutOnClickHandler} style={{ backgroundColor: '#a49bbc', padding: 10, borderRadius: 10, width: "100%", marginVertical: 3 }}>
                                            <Text style={{ fontSize: 16, fontWeight: "bold", color: 'white', textAlign: "center" }}>Book Now</Text>
                                        </TouchableOpacity>
                                    </View>

                                </View>
                            </View>

                        </Callout>
                    </Marker>
                ))}

            </MapView>
        </View>)
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
    },
    map: {
        width: '100%',
        height: '100%',
    },
    customMarker: {
        width: 60,
        height: 60,
        resizeMode: 'contain', // Adjust resizeMode as needed
    },
    calloutContainer: {
        padding: 0,
        width: 250,
        height: 300,
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        borderRadius: 10,
        margin: 0
    },
    DashboardCard: {
        width: '100%',
        elevation: 3,
        shadowColor: 'grey',
        shadowOffset: { width: 0, height: 1 },
        shadowOpacity: 0.8,
        shadowRadius: 1,
        borderRadius: 10,
        height: 'auto',
        paddingBottom: 20,
    },
    CardContentContainer: {
        marginVertical: 5,
        borderColor: 'grey',
        width: '100%',
    },
    DashboardBadge: {
        backgroundColor: '#a49bbc',
        display: 'flex',
        flexDirection: 'row',
        gap: 5,
        paddingHorizontal: 10,
        paddingVertical: 3,
        borderRadius: 10,
        alignItems: 'center',
        marginVertical: 5
    },
    CardBadgeContainer: {
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-between',
        width: '100%',
    }

});
